describe("Discount",function(){it("have discount is percent",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("20%",100);expect(n).toEqual(20)}),it("have discount is percent and percent",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("20%,10%",100);expect(n).toEqual(28)}),it("have discount is number",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("5",100);expect(n).toEqual(5)}),it("have discount is number and number",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("15,5",100);expect(n).toEqual(20)}),it("have discount is percent and number",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("15%,5",100);expect(n).toEqual(20)}),it("have discount is number and percent",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("10,10%",100);expect(n).toEqual(19)}),it("have discount is float and percent",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("5.8,10%",105.8);expect(n).toEqual(15.8)}),it("have discount is string",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("aa",105.8);expect(n).toEqual(0)}),it("have discount is empty",function(){var n=GlobalService.DiscountSrv.GetDiscountAmount("",105.8);expect(n).toEqual(0)})})